import React from 'react';
import '../styles/Topbar.module.css';

const Topbar = () => {
  return (
    <header className="dashboard-header">
      <div className="logo">Admin Dashboard</div>
      <div className="header-actions">
        <div className="notification-bell" onClick={() => window.location.href = '/notifications'}>
          <i className="fas fa-bell"></i>
        </div>
        <div className="profile" onClick={() => window.location.href = '/profile'}>
          <img src="/path/to/profile-pic.png" alt="Profile" className="profile-pic" />
          <span className="profile-name">Admin Name</span>
        </div>
      </div>
    </header>
  );
};

export default Topbar;
